// ToDoItem.js - Component to render each to-do item
import React from 'react';

const ToDoItem = ({ text, completed, toggleToDo, deleteToDo }) => {
  return (
    <li className={`todo-item ${completed ? 'completed' : ''}`}>
      <span onClick={toggleToDo} className="todo-text">
        {text}
      </span>
      <button onClick={deleteToDo} className="delete-button">
        Delete
      </button>
    </li>
  );
};

export default ToDoItem;
